import React from 'react'

const LeaderboardTable = props =>{
    var rank =1;
    return(

        <div className={"leaderboard-table"}>
            <h3>{props.instance}</h3>
            <table border={1}>
            <thead><th>Rank</th><th>Player</th><th>Score</th></thead>
            <tbody >

            {
                props.players.map((player)=>{
                    console.log(props.instance+"_"+player)
                    return <tr key={props.instance+"_"+player}><td>2</td><td>1</td><td>{props.playerScores[player]}</td></tr>
                })} 


            </tbody>
        </table>
        </div>
    )
}

export default LeaderboardTable
